import {
  HideBetween,
  HideDuring,
  HideOn,
  HideScroll,
} from "react-hide-on-scroll";
import './App.css';

import Header from "./Components/Header";
import About from "./Components/About"

function App() {
  return (
    <div className="App">
      <HideScroll variant="down" showOnPageInit={true}>
        <Header/>
      </HideScroll>
      <About/>

      <div style={{height: '2000px', width: "100%", backgroundColor: 'red'}}>
        div filler
      </div>
    </div>
  );
}

export default App;
